let width=window.innerWidth/100;
let height=window.innerHeight/100
export const res2={
    stats:{
        image:function(image)
        {
            let style={
                width:`${10*width}px`,
                height:`${20*height}px`,
                position:'relative',
                top:`${20*height}px`,
                left:`${10*width}px`,
                backgroundImage:`url(${image})`,
                backgroundSize:`${10*width}px ${20*height}px`,
            }
            return style;
        },
        leaderboard:function(){
            let width=window.innerWidth/100,height=window.innerHeight/100
            let style={
                position:'relative',
                height:`${6*height}px`,
                width:`${13*width}px`,
                backgroundColor:'#0f100c',
                border:'grey',
                display:'block',
                color:'whitesmoke',
                fontSize:`${Math.min(1.8*height,1.8*width)}px`,
                zIndex:'1',
                border:`${Math.min(0.05*height,0.05*width)}px solid grey`
            }
            return style;
        }
    }
}
